SELECT doc #> '{filter_level}' as group, COUNT(doc #> '{place,name}') FROM Twitter  WHERE jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")')  GROUP BY doc #> '{filter_level}';
SELECT doc #> '{retweeted_status,user,location}' as group, SUM((doc #>> '{favorite_count}')::float) FROM Twitter  WHERE ( ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.friends_count ? (@ <= 2151584.114948)') AND jsonb_path_exists(doc,'$.quoted_status.user.profile_sidebar_fill_color') ) OR jsonb_path_exists(doc,'$.quoted_status.user.url ? (@ starts with "ht")') ) OR jsonb_path_exists(doc,'$.retweeted_status.user.id_str') ) ) AND jsonb_path_exists(doc,'$.favorite_count.type() ? (@ == "number")') )  GROUP BY doc #> '{retweeted_status,user,location}';
SELECT doc #> '{quoted_status,place,url}' as group, COUNT(doc #> '{retweeted}') FROM Twitter  WHERE ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( ( ( ( ( jsonb_path_exists(doc,'$.retweeted_status.in_reply_to_user_id_str ? (@ starts with "7")') OR jsonb_path_exists(doc,'$.retweeted_status.in_reply_to_user_id_str ? (@ starts with "2")') ) OR jsonb_path_exists(doc,'$.retweeted_status.in_reply_to_user_id_str ? (@ starts with "3")') ) OR jsonb_path_exists(doc,'$.retweeted_status.in_reply_to_user_id_str ? (@ starts with "6")') ) OR jsonb_path_exists(doc,'$.in_reply_to_user_id ? (@ == 196237365303820530)') ) OR jsonb_path_exists(doc,'$.quoted_status.in_reply_to_user_id ? (@ == 668797006026254403)') ) OR jsonb_path_exists(doc,'$.retweeted_status.filter_level ? (@ starts with "l")') ) )  GROUP BY doc #> '{quoted_status,place,url}';
SELECT doc #> '{retweeted_status,quoted_status_id_str}' as group, COUNT(*) FROM Twitter  WHERE ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.entities.symbols') OR jsonb_path_exists(doc,'$.retweeted_status.quoted_status.place') ) OR jsonb_path_exists(doc,'$.retweeted_status.filter_level') ) )  GROUP BY doc #> '{retweeted_status,quoted_status_id_str}';
SELECT doc #> '{quoted_status,id_str}' as group, COUNT(*) FROM Twitter  WHERE ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( jsonb_path_exists(doc,'$.place.place_type ? (@ starts with "c")') OR jsonb_path_exists(doc,'$.place.place_type ? (@ starts with "a")') ) OR jsonb_path_exists(doc,'$.user.location.type() ? (@ == "string")') ) )  GROUP BY doc #> '{quoted_status,id_str}';
SELECT doc #> '{retweeted_status,user,default_profile_image}' as group, COUNT(doc #> '{scopes}') FROM Twitter  WHERE jsonb_path_exists(doc,'$.retweeted')  GROUP BY doc #> '{retweeted_status,user,default_profile_image}';
SELECT doc #> '{retweeted_status,in_reply_to_user_id}' as group, SUM((doc #>> '{user,friends_count}')::float) FROM Twitter  WHERE ( jsonb_path_exists(doc,'$.retweeted_status.user.notifications') AND jsonb_path_exists(doc,'$.user.friends_count.type() ? (@ == "number")') )  GROUP BY doc #> '{retweeted_status,in_reply_to_user_id}';
SELECT doc #> '{quoted_status,user,is_translator}' as group, COUNT(doc #> '{retweeted_status,quoted_status,user,utc_offset}') FROM Twitter  WHERE ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.favorited') OR jsonb_path_exists(doc,'$.user.profile_background_image_url_https') )  GROUP BY doc #> '{quoted_status,user,is_translator}';
SELECT doc #> '{retweeted_status,quoted_status,source}' as group, COUNT(doc #> '{retweeted_status,quoted_status,id_str}') FROM Twitter  WHERE ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.favorited') OR jsonb_path_exists(doc,'$.user.profile_background_image_url_https') ) AND ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.default_profile') OR jsonb_path_exists(doc,'$.quoted_status.user.time_zone ? (@ starts with "Asia")') ) OR ( ( jsonb_path_exists(doc,'$.quoted_status.user.created_at ? (@ starts with "S")') OR jsonb_path_exists(doc,'$.quoted_status.user.created_at ? (@ starts with "T")') ) OR jsonb_path_exists(doc,'$.quoted_status.user.created_at ? (@ starts with "M")') ) ) OR jsonb_path_exists(doc,'$.user.profile_background_tile ? (@ == false)') ) )  GROUP BY doc #> '{retweeted_status,quoted_status,source}';
SELECT doc #> '{text}' as group, COUNT(*) FROM Twitter  WHERE ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.favorited') OR jsonb_path_exists(doc,'$.user.profile_background_image_url_https') ) AND ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.default_profile') OR jsonb_path_exists(doc,'$.quoted_status.user.time_zone ? (@ starts with "Asia")') ) OR ( ( jsonb_path_exists(doc,'$.quoted_status.user.created_at ? (@ starts with "S")') OR jsonb_path_exists(doc,'$.quoted_status.user.created_at ? (@ starts with "T")') ) OR jsonb_path_exists(doc,'$.quoted_status.user.created_at ? (@ starts with "M")') ) ) OR jsonb_path_exists(doc,'$.user.profile_background_tile ? (@ == false)') ) ) AND ( ( jsonb_path_exists(doc,'$.retweeted_status.user.is_translator ? (@ == true)') OR jsonb_path_exists(doc,'$.retweeted_status.extended_tweet.entities.urls') ) OR jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.profile_link_color.type() ? (@ == "string")') ) )  GROUP BY doc #> '{text}';
